/*! Pushy - v0.9.1 - 2013-9-16
* Pushy is a responsive off-canvas navigation menu using CSS transforms & transitions.
* https://github.com/christophery/pushy/
* by Christopher Yee */
/*! Pushy - v0.9.1 - 2013-9-16
* Pushy is a responsive off-canvas navigation menu using CSS transforms & transitions.
* https://github.com/christophery/pushy/
* by Christopher Yee */

$(function() {
	var pushy = $('.pushy'), //menu css class
		body = $('body'),
		container = $('#container'), //container css class
		push = $('.push'), //css class to add pushy capability
		siteOverlay = $('.site-overlay'), //site overlay
		pushyClass = "pushy-left pushy-open", //menu position & menu open class
		pushyActiveClass = "pushy-active", //css class to toggle site overlay
		containerClass = "container-push", //container open class
		pushClass = "push-push", //css class to add pushy capability
		menuBtn = $('.menu-btn, .pushy a'), //css classes to toggle the menu
		menuSpeed = 200, //jQuery fallback menu speed
		menuWidth = pushy.width() + "px"; //jQuery fallback menu width

		pushyIsActive = false;
		
		/*
		document.ontouchmove = function(event){
			if(pushyIsActive) {
				event.preventDefault();
			}
		}
		*/
		
		
		if( parseInt(getAndroidVersion()) == 2) {
			$(".pushy a").on('click touchend', function() {				
				document.location.href = $(this).attr("href");
			});
		}
		else {			
			jQuery(function($) {

			  $(document).on("touchmove", function(evt) { if(pushyIsActive) { evt.preventDefault() } });
			  $(document).on("touchmove dragstart dragmove dragend", ".pushy", function(evt) { evt.stopPropagation() });
				
				
				$(".pushy").on("touchmove", function(evt){
					evt.stopPropagation();
				});
			});

		}

	function pushyClosed() {
		pushyIsActive = false;
		$("body").height( "auto");
	}

	function pushyOpened() {
		pushyIsActive = true;
		$("body").height( screen.height + "px");
	}

	function togglePushy(){
		body.toggleClass(pushyActiveClass); //toggle site overlay
		pushy.toggleClass(pushyClass);
		container.toggleClass(containerClass);
		push.toggleClass(pushClass); //css class to add pushy capability

		if(body.hasClass( pushyActiveClass )) {
			pushyOpened();
		}
		else {
			pushyClosed();
		}
	}

	function openPushyFallback(){
		body.addClass(pushyActiveClass);
		pushy.animate({left: "0px"}, menuSpeed);
		container.animate({left: menuWidth}, menuSpeed);
		push.animate({left: menuWidth}, menuSpeed); //css class to add pushy capability
		pushyOpened();
	}

	function closePushyFallback(){
		body.removeClass(pushyActiveClass);
		pushy.animate({left: "-" + menuWidth}, menuSpeed);
		container.animate({left: "0px"}, menuSpeed);
		push.animate({left: "0px"}, menuSpeed); //css class to add pushy capability
		pushyClosed();
	}

	if(Modernizr.csstransforms3d){
		//toggle menu
		menuBtn.on("click", function() {
			togglePushy();
		});
		//close menu when clicking site overlay
		siteOverlay.click(function(){ 
			togglePushy();
		});
	}else{
		//jQuery fallback
		pushy.css({left: "-" + menuWidth}); //hide menu by default
		container.css({"overflow-x": "hidden"}); //fixes IE scrollbar issue

		//keep track of menu state (open/close)
		var state = true;

		//toggle menu
		menuBtn.on("click", function() {
			if (state) {
				openPushyFallback();
				state = false;
			} else {
				closePushyFallback();
				state = true;
			}
		});

		//close menu when clicking site overlay
		siteOverlay.on("click", function(){ 
			if (state) {
				openPushyFallback();
				state = false;
			} else {
				closePushyFallback();
				state = true;
			}
		});
	}
});


